import React from "react";
import ReactDOM from "react-dom";
import App from "./app";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
import individual_Bank from "./Individual_Bank_Details/individual_Bank";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Switch>
        <Route
          exact
          path="/"
          component={App}
          render={() => <Redirect to="/all-banks" />}
        />
        {/* <Route exact path="/Favourites" component={Fav} /> */}
        <Route exact path="/bank-details/:ifsc" component={individual_Bank} />
      </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
